import React from 'react';
import '../../App.css';

const Notifications = () => {
  return (
    <div className="feature-container">
      <h1>Notifications for City Councils</h1>
      <p>
        Notifications alert city councils to new reports, enabling timely responses
        and efficient cleanup operations.
      </p>
    </div>
  );
};

export default Notifications;
